import { useEffect, useState } from "react";
import axios from "axios";

function ProductManagement() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8080/user")
      .then(response => {
        setUsers(response.data);
      })
      .catch(error => {
        console.error("Error fetching users:", error);
      });
  }, []);

  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-6">
        <div className="text-2xl font-bold">상품관리</div>
      </div>

      <div className="overflow-x-auto">
        <table className="min-w-full border border-gray-200">
          <thead className="bg-gray-100">
            <tr>
              <th className="px-4 py-2 border">아이디</th>
              <th className="px-4 py-2 border">비밀번호</th>
              <th className="px-4 py-2 border">이름</th>
              <th className="px-4 py-2 border">주소</th>
              <th className="px-4 py-2 border">전화번호</th>
              <th className="px-4 py-2 border">이메일</th>
              <th className="px-4 py-2 border">관리</th>
            </tr>
          </thead>
          <tbody>
            {users.length > 0 ? (
              users.map((user) => (
                <tr key={user.id}>
                  <td className="px-4 py-2 border">{user.username}</td>
                  <td className="px-4 py-2 border">{user.password}</td>
                  <td className="px-4 py-2 border">{user.name}</td>
                  <td className="px-4 py-2 border">{user.address}</td>
                  <td className="px-4 py-2 border">{user.phone}</td>
                  <td className="px-4 py-2 border">{user.email}</td>
                  <td className="px-4 py-2 border text-center">
                    {/* 관리 버튼 (예: 수정/삭제 버튼 나중에 추가 가능) */}
                    <button className="text-blue-500">Edit</button>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="7" className="text-center py-8 text-gray-500">
                  No data available
                </td>
              </tr>
            )}
          </tbody>
        </table>

        <div className="flex justify-end mt-4 items-center gap-2 text-sm text-gray-700">
          <span>Rows per page:</span>
          <select className="border rounded px-2 py-1">
            <option>10</option>
            <option>20</option>
            <option>30</option>
          </select>
          <span>-</span>
          <button className="px-2">&lt;</button>
          <button className="px-2">&gt;</button>
        </div>
      </div>
    </div>
  );
}

export default ProductManagement;
